Here's a function that takes a `date` (a `Date` object) representing the post's creation time and returns the elapsed time since the post was made in a human-readable format:

```typescript
function timeSince(date: Date): string {
  const seconds = Math.floor((new Date().getTime() - date.getTime()) / 1000);

  let interval = seconds / 60;
  let time = Math.floor(interval);

  const units = ['second', 'minute', 'hour', 'day', 'week', 'month', 'year'];
  const unit = units[Math.floor(Math.log(time) / Math.log(60))];
  const plural = time >= 4 ? 's' : '';

  return `${time} ${unit}${plural} ago`;
}

// Example usage:
const postDate = new Date('2022-01-01T00:00:00Z');
console.log(timeSince(postDate)); // Output: "1 year ago"
```

This function calculates the elapsed time in seconds and then converts it to minutes, hours, days, weeks, months, or years based on the number of seconds. It uses the logarithm function to determine the appropriate unit for the elapsed time. The `Math.floor` function is used to round down the result to the nearest integer, and the `units` array contains the names of the time units. The `plural` variable is used to add an 's' to the unit name when the elapsed time is greater than 4.

